//candidates: ÌõÑÎ≥¥Ïûê IDÎ•º ÌÇ§Î°ú ÌïòÍ≥† candidate Íµ¨Ï°∞Ï≤¥Î•º Í∞íÏúºÎ°ú Í∞ÄÏßÄÎäî Îß§Ìïë
//candidateCount: ÌõÑÎ≥¥Ïûê ÏàòÎ•º Ï†ÄÏû•Ìï©ÎãàÎã§.
