//Ï†úÌïúÏûê 
//ownerOnly: Ïò§ÏßÅ ÏÜåÏú†ÏûêÎßå Ìï¥Îãπ Ìï®ÏàòÎ•º Ìò∏Ï∂úÌï† Ïàò ÏûàÎèÑÎ°ù Ï†úÌïúÌï©ÎãàÎã§.
//duringVotingPeriod: ÏÑ†Í±∞ Í∏∞Í∞Ñ ÎèôÏïàÎßå Ìï¥Îãπ Ìï®ÏàòÎ•º Ìò∏Ï∂úÌï† Ïàò ÏûàÎèÑÎ°ù Ï†úÌïúÌï©ÎãàÎã§

//Ìï®Ïàò
//ÏÉùÏÑ±ÏûêÌï®Ïàò : electionName, startTime, endTime :Ï¥àÍ∏∞Ìôî,thdbwk tjdwjd
//addCandidate:ÏÜåÏú†ÏûêÍ∞Ä ÌõÑÎ≥¥ÏûêÎ•º Ï∂îÍ∞ÄÌïòÎäî Ìï®ÏàòÏûÖÎãàÎã§.
//authorize: ÏÜåÏú†ÏûêÍ∞Ä Ìà¨ÌëúÏûêÏóêÍ≤å Í∂åÌïúÏùÑ Î∂ÄÏó¨ÌïòÎäî Ìï®ÏàòÏûÖÎãàÎã§.
//unauthorize: ÏÜåÏú†ÏûêÍ∞Ä Ìà¨ÌëúÏûêÏóêÍ≤å Í∂åÌïúÏùÑ Ï∑®ÏÜåÌïòÎäî Ìï®ÏàòÏûÖÎãàÎã§.
//vote: Ìà¨ÌëúÏûêÍ∞Ä ÌõÑÎ≥¥ÏûêÏóêÍ≤å Ìà¨ÌëúÌïòÎäî Ìï®ÏàòÏûÖÎãàÎã§. Ìà¨ÌëúÏûêÎäî Í∂åÌïúÏù¥ Î∂ÄÏó¨ÎêòÏñ¥ ÏûàÏñ¥Ïïº ÌïòÎ©∞, Ï§ëÎ≥µ ÌäúÌëúÍ∞Ä Î∂àÍ∞ÄÌï©ÎãàÎã§
//end: Ìà¨ÌëúÎ•º Ï¢ÖÎ£åÌïòÍ≥† Í≤∞Í≥ºÎ•º Î∞òÌôòÌïòÎäî Ìï®Ïàò
//getCandidate: ÌäπÏ†ï ÌõÑÎ≥¥ÏûêÏùò Ï†ïÎ≥¥Î•º Ï°∞ÌöåÌïòÎäî Ìï®ÏàòÏûÖÎãàÎã§.


//Ïù¥Î≤§Ìä∏








contract Voting {
    //ÌõÑÎ≥¥Ïûê Íµ¨Ï°∞Ï≤¥ Ï†ïÏùò
    struct Candidate {
        uint id;         // ÌõÑÎ≥¥Ïûê ID
        string name;     // ÌõÑÎ≥¥Ïûê Ïù¥Î¶Ñ
        uint voteCount;  // Ìà¨Ìëú Ïàò
    }

    //Ìà¨ÌëúÏûê Íµ¨Ï°∞Ï≤¥ Ï†ïÏùò
    struct Voter {
        bool authorized; // Í∂åÌïú Ïó¨Î∂Ä
        bool voted;      // Ìà¨Ìëú Ïó¨Î∂Ä
        uint vote;       // Ìà¨ÌëúÌïú ÌõÑÎ≥¥Ïûê ID
    }

    // üìã ÏÑ†Í±∞ Í≤∞Í≥º Íµ¨Ï°∞Ï≤¥ Ï†ïÏùò
    struct ElectionResult {
        string winnerName;
        uint winnerVotes;
        uint totalVotes;
        uint timestamp;
        bool announced;
    }

//Ïª®Ìä∏ÎûôÌä∏ Î≥ÄÏàò ÏÑ§Î™Ö
    address public owner;
    string public electionName; //ÏÑ†Í±∞ Ïù¥Î¶Ñ
    uint public startTime; //ÏÑ†Í±∞ ÏãúÏûë ÏãúÍ∞Ñ
    uint public endTime; //ÏÑ†Í±∞ Ï¢ÖÎ£å ÏãúÍ∞Ñ
    bool public electionClosed; // ÏàòÎèô Ï¢ÖÎ£å Ïó¨Î∂Ä Ï∂îÍ∞Ä
    ElectionResult public finalResult; // ÏµúÏ¢Ö Í≤∞Í≥º Ï†ÄÏû•

    mapping(address => Voter) public voters; //Ìà¨ÌëúÏûê Ï£ºÏÜåÎ•º ÌÇ§Î°ú ÌïòÍ≥† Voter Íµ¨Ï°∞Ï≤¥Î•º Í∞íÏúºÎ°ú Í∞ÄÏßÄÎäî Îß§Ìïë
    mapping(uint => Candidate) public candidates; //ÌõÑÎ≥¥Ïûê IDÎ•º ÌÇ§Î°ú ÌïòÍ≥† candidate Íµ¨Ï°∞Ï≤¥Î•º Í∞íÏúºÎ°ú Í∞ÄÏßÄÎäî Îß§ÌïÑ
     uint public candidateCount; //ÌõÑÎ≥¥Ïûê Ïàò
     uint public totalVotes; //Ï¥ù Ìà¨Ìëú Ïàò

    // üéØ Í∞ÑÎã® Ï°∞ÌöåÏö© public Î≥ÄÏàòÎì§ (Ïù¥ÎçîÏä§Ï∫îÏóêÏÑú Î∞îÎ°ú ÌôïÏù∏ Í∞ÄÎä•)
    string public officialWinner = "";           // Í≥µÏãù ÏäπÏûê Ïù¥Î¶Ñ
    uint public officialWinnerVotes = 0;         // ÏäπÏûê ÎìùÌëúÏàò  
    bool public officialResultAnnounced = false; // Í≤∞Í≥º Î∞úÌëú Ïó¨Î∂Ä
    string public electionSummary = "";          // ÌïúÏ§Ñ ÏöîÏïΩ

//Ï†úÌïúÏûê ÏÑ§Î™Ö
    modifier onlyOwner(){
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier duringVotingPeriod() {
        require(block.timestamp >= startTime, "Voting has not started yet");
        require(block.timestamp <= endTime && !electionClosed, "Voting has ended");
        _;
    }

    modifier electionEnded() {
        require(block.timestamp > endTime || electionClosed, "Election is still ongoing");
        _;
    }

//ÏÉùÏÑ±Ïûê Ìï®Ïàò ÏÑ§Î™Ö
    constructor(string memory _name, uint _votingDuration){ //ÏÉùÏÑ±Ïûê Ìï®Ïàò Ï¥àÍ∏∞Ìôî
        owner = msg.sender; //ÏÜåÏú†Ïûê Ï£ºÏÜå ÏÑ§Ï†ï
        electionName = _name; //ÏÑ†Í±∞ Ïù¥Î¶Ñ ÏÑ§Ï†ï
        startTime = block.timestamp; //ÏÑ†Í±∞ ÏãúÏûë ÏãúÍ∞Ñ ÏÑ§Ï†ï
        endTime = block.timestamp + _votingDuration; //ÏÑ†Í±∞ Ï¢ÖÎ£å ÏãúÍ∞Ñ ÏÑ§Ï†ï
        electionClosed = false; // Ï¥àÍ∏∞Í∞í ÏÑ§Ï†ï
    }

    function addCandidate(string memory _name) public onlyOwner{ //ÌõÑÎ≥¥Ïûê Ï∂îÍ∞Ä Ìï®Ïàò
        candidateCount++; //ÌõÑÎ≥¥Ïûê Ïàò Ï¶ùÍ∞Ä
        candidates[candidateCount] = Candidate(candidateCount, _name, 0); //ÌõÑÎ≥¥Ïûê Ï∂îÍ∞Ä
        emit CandidateAdded(candidateCount, _name);
    }

    function authorize(address _person) public onlyOwner { //Í∂åÌïú Î∂ÄÏó¨ Ìï®Ïàò
        require(!voters[_person].voted, "Person has already voted");
        voters[_person].authorized = true;
        emit VoterAuthorized(_person);
    }

    function unauthorize(address _person) public onlyOwner { //Í∂åÌïú Ï∑®ÏÜå Ìï®Ïàò
        require(!voters[_person].voted, "Cannot unauthorize after voting");
        voters[_person].authorized = false;
        emit VoterUnauthorized(_person);
    }

    function vote(uint _candidateId) public duringVotingPeriod { //Ìà¨Ìëú Ìï®Ïàò
        require(voters[msg.sender].authorized, "Not authorized to vote");
        require(!voters[msg.sender].voted, "Already voted");
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");

        voters[msg.sender].voted = true;
        voters[msg.sender].vote = _candidateId;
        candidates[_candidateId].voteCount++;
        totalVotes++;

        emit VoteCast(msg.sender, _candidateId);
    }

    // üîí ÏàòÎèô Ìà¨Ìëú Ï¢ÖÎ£å Ìï®Ïàò (Î∞∞Ìè¨ÏûêÎßå Ìò∏Ï∂ú Í∞ÄÎä•)
    function closeElection() public onlyOwner {
        require(!electionClosed, "Election already closed");
        require(block.timestamp >= startTime, "Election has not started yet");

        electionClosed = true;
        emit ElectionClosed(block.timestamp);
    }

    // üì¢ Í≤∞Í≥º Í≥µÌëú Î∞è ÏäπÏûê Î∞úÌëú Ìï®Ïàò
    function announceWinner() public onlyOwner electionEnded returns (string memory) {
        require(!finalResult.announced, "Winner already announced");
        require(totalVotes > 0, "No votes cast");

        uint winningVoteCount = 0;
        string memory winnerName = "";

        // ÏµúÍ≥† ÎìùÌëú ÌõÑÎ≥¥ Ï∞æÍ∏∞
        for (uint i = 1; i <= candidateCount; i++) {
            if (candidates[i].voteCount > winningVoteCount) {
                winningVoteCount = candidates[i].voteCount;
                winnerName = candidates[i].name;
            }
        }

        // ÏµúÏ¢Ö Í≤∞Í≥º Î∏îÎ°ùÏ≤¥Ïù∏Ïóê Í∏∞Î°ù
        finalResult = ElectionResult({
            winnerName: winnerName,
            winnerVotes: winningVoteCount,
            totalVotes: totalVotes,
            timestamp: block.timestamp,
            announced: true
        });

        // üéØ Í∞ÑÎã® Ï°∞ÌöåÏö© Î≥ÄÏàòÎì§ ÏóÖÎç∞Ïù¥Ìä∏ (Ïù¥ÎçîÏä§Ï∫îÏóêÏÑú Î∞îÎ°ú ÌôïÏù∏ Í∞ÄÎä•)
        officialWinner = winnerName;
        officialWinnerVotes = winningVoteCount;
        officialResultAnnounced = true;
        electionSummary = string(abi.encodePacked(
            winnerName, " WON with ", uint2str(winningVoteCount), "/", uint2str(totalVotes), " votes"
        ));

        emit WinnerAnnounced(winnerName, winningVoteCount, totalVotes, block.timestamp);

        return string(abi.encodePacked(
            "OFFICIAL WINNER: ", winnerName, 
            " with ", uint2str(winningVoteCount), 
            " votes out of ", uint2str(totalVotes), " total votes"
        ));
    }

    // üìä ÏÉÅÏÑ∏ Í≤∞Í≥º Ï°∞Ìöå Ìï®Ïàò
    function getDetailedResults() public view returns (
        string[] memory candidateNames, 
        uint[] memory voteCounts, 
        string memory winner,
        bool isFinalized
    ) {
        candidateNames = new string[](candidateCount);
        voteCounts = new uint[](candidateCount);

        for (uint i = 1; i <= candidateCount; i++) {
            candidateNames[i-1] = candidates[i].name;
            voteCounts[i-1] = candidates[i].voteCount;
        }

        if (finalResult.announced) {
            winner = finalResult.winnerName;
            isFinalized = true;
        } else {
            winner = "Not announced yet";
            isFinalized = false;
        }
    }

    function end() public onlyOwner view returns (string memory){ //Ìà¨Ìëú Ï¢ÖÎ£å Ìï®Ïàò
        require(block.timestamp > endTime || electionClosed, "Voting period has not ended yet");
        if (totalVotes == 0) {
            return "No votes cast";
        }

        uint winningVoteCount = 0;
        string memory winnerName = "";

        for (uint i = 1; i <= candidateCount; i++) {
            if (candidates[i].voteCount > winningVoteCount) {
                winningVoteCount = candidates[i].voteCount;
                winnerName = candidates[i].name;
            }
        }

        return string(abi.encodePacked("Winner: ", winnerName, " with ", uint2str(winningVoteCount), " votes"));
    }

    // Helper function to convert uint to string
    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

    function getCandidate(uint _candidateId) public view returns (string memory, uint){ //ÌõÑÎ≥¥Ïûê Ï†ïÎ≥¥ Ï°∞Ìöå Ìï®Ïàò
        require(_candidateId > 0 && _candidateId <= candidateCount, "Invalid candidate ID");
        Candidate memory candidate = candidates[_candidateId];
        return (candidate.name, candidate.voteCount);
    }

    function getResults() public view returns (uint[] memory) {
        uint[] memory result = new uint[](candidateCount);
        for (uint i = 1; i <= candidateCount; i++) {
            result[i-1] = candidates[i].voteCount;
        }
        return result;
    }

    function getElectionStatus() public view returns (bool) {
        return block.timestamp <= endTime && !electionClosed;
    }

    event VoteCast(address voter, uint candidateId);
    event CandidateAdded(uint candidateId, string name);
    event VoterAuthorized(address voter);
    event VoterUnauthorized(address voter);
    event ElectionClosed(uint timestamp);
    event WinnerAnnounced(string winnerName, uint winnerVotes, uint totalVotes, uint timestamp);
}

